import React from 'react';
import './App.css';

interface UserProps{
    name: String,
    email: String
}
const User =  (props: UserProps) =>  {
  return (
        <div>
            <p>Name : {props.name}</p>
            <p>Email : {props.email}</p>
        </div>
  );
}

export default User;
